INSERT INTO `wp_term_taxonomy` VALUES (1,1,'category','',0,1),(2,2,'tnc_tax_27','Objetos usados na caa, tiro ao alvo, guerra ou proteao pessoal. Exclui equipamento projetado para o transporte de tropas e suprimentos, indumentria e respectivos acessrios.Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(3,3,'tnc_tax_27','Objetos usados na conservao, manuteno e funcionamento das armas. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',2,0),(4,4,'tnc_tax_27','Inclui, tambm, as de treinamento. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',2,0),(5,5,'tnc_tax_27','Objetos usados na proteo do corpo do homem e do animal, em situaes de combate. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',2,0),(6,6,'tnc_tax_27','Inclui, tambm, as de treinamento. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',2,0),(7,7,'tnc_tax_27','Exclui armas. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',2,0),(8,8,'tnc_tax_27','Objetos criados, geralmente, com fins estticos ou como demonstrao de criatividade e que integram as artes grficas, plsticas e cinematogrfica. Exclui a fotografia e respectivas cpias fotomecnicas. Ver tambm COMUNICAO, EQUIPAMENTO DE ARTES DO ESPETCULO e EQUIPAMENTO DE ARTISTAS/ARTESOS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(9,9,'tnc_tax_27','Objetos que no so considerados propriamente pinturas e esculturas, para fins de classificao, mas, que se assemelham s mesmas e que apresentam em suas estruturas elementos pr-fabricados, amostras minerais e vegetais, mecanismos, luz, movimento etc. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.\" Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',8,0),(10,10,'tnc_tax_27','',8,0),(11,11,'tnc_tax_27','',8,0),(12,12,'tnc_tax_27','Imagens, sobre papel, resultantes das tcnicas de gravura e/ou impresso. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',8,0),(13,13,'tnc_tax_27','',8,0),(14,14,'tnc_tax_27','',8,0),(15,15,'tnc_tax_27','Objetos relativos a dinheiro ou representativos de dinheiro, bem como aqueles que servem de instrumento para obteno de servios bem definidos (ex. :moeda, selo postal, vale etc.).  Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(16,16,'tnc_tax_27','Construes criadas para atender a qualquer necessidade humana em local relativamente permanente. Inclui os respectivos fragmentos. Ver tambm INTERIORES. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(17,17,'tnc_tax_27','Usar apenas quando o abrigo como um todo  catalogado. Inclui os frgeis e portteis (ex.: casa, mausolu, capela, estbulo, casa de cachorro, barraca etc,). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',16,0),(18,18,'tnc_tax_27','Aquelas criadas para servir a alguma necessidade humana que no a de abrigo e desassociadas de edifcios (ex.: chafariz, ponte etc.). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',16,0),(19,19,'tnc_tax_27','Objetos existentes, em geral, dentro de edifcios, conectados de forma mais ou menos permanente ao sistema de gua e esgoto. Inclui os respectivos acessrios. Ver tambm FRAGMENTO DE CONSTRUO.  Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',16,0),(20,20,'tnc_tax_27','Objetos criados para ser parte de uma construo ou acessrios para seu funcionamento (ex: telha, tijolo, porta, dobradia etc.). Ver tambrn EQUIPAMENTO HIDRULICO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',16,0),(21,21,'tnc_tax_27','Objetos usados no interior ou em torno de edifcios, com o propsito de proporcionar conforto, cuidado prazer aos seus ocupantes. Ver tambm - CONSTRUAO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(22,22,'tnc_tax_27','Objetos usados dentro ou em torno de um edifcio com propsitos utilitrios relativamente menores, ou ento quando no se enquadram nas demais subclasses do item 05. Exclui ARTIGO DE TABAGISMO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',21,0),(23,23,'tnc_tax_27','Objetos criados para modificar a temperatura e a umidade de um ambiente fechado. Inclui os respectivos acessrios (ex.: ventilador, guarda-fogo etc.). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',21,0),(24,24,'tnc_tax_27','Objetos usados na limpeza de recintos e na lavagem de roupa, sejam esses servios realizados em edifcios pblicos ou privados. Ver tambm TRABALHO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',21,0),(25,25,'tnc_tax_27','Inclui os respectivos acessrios e instalaes especializadas, tais como iluminaao de rua, de jardim e aparelhos de iluminaao teatral. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',21,0),(26,26,'tnc_tax_27','Inclui todo tipo de mobilirio. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',21,0),(27,27,'tnc_tax_27','Objetos usados no preparo, guarda, servio ou consumo de alimentos e bebidas. Inclui, tambm, aparelhos (ex.: fogo, geladeira etc.). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',21,0),(28,28,'tnc_tax_27','Objetos usados pelo homem nas suas atividades de trabalho. No se diferenciou trabalho de hobby. Exclui mobilirio e indumentria profissionais. Ver tambm COMUNICAO, EQUIPAMENTO DE SERVIOS DOMSTICOS e MEDIO/REGISTRO/OBSERVAO/PROCESSAMENTO Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(29,29,'tnc_tax_27','Objetos usados no cultivo do solo com culturas permanentes ou temporrias, inclusive hortalias e flores. Inclui, ainda, o equipamento utilizado na produo de alimentos e bebidas, jardinagem, extrao vegetal, silvicultura e reflorestarnento. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(30,30,'tnc_tax_27','Objetos usados na produo de msica e respectivos acessrios. Ver tambm EQUIPAMENTO DE ARTISTAS/ARTESOS e EQUIPAMENTO DE COMUNICAO SONORARA/VISUAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(31,31,'tnc_tax_27','Equipamento de trabalho mecnico ou eletrnico que no se enquadra nas demais subclasses do item 06. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(32,32,'tnc_tax_27','Objetos usados na captura de peixes, crustceos e moluscos. Exclui embarcaes e armas. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(33,33,'tnc_tax_27','Objetos usados durante a realizao de espetculos teatrais, de dana, pera, circo e de filmagens. Exclui indumentria, adornos, mobilirio e objetos de iluminao. Ver tambm ARTES VISUAIS/CINEMATOGRFICA e EQUIPAMENTO DE ARTISTAS/ARTESOS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(34,34,'tnc_tax_27','Ver tambm ARTES VISUAIS/CINEMATOGRFICA, EQUIPAMENTO DE ARTES DO ESPETCULO, EQUIPAMENTO DE FIAO/TECELAGEM e INSTRUMENTO MUSICAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(35,35,'tnc_tax_27','Objetos usados na venda de mercadorias e servios. Ver tambm MATERIAL DE PROPAGANDA. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(36,36,'tnc_tax_27','Objetos usados no fabrico de fios, linhas ou cordas, ou na manufatura de tecidos ou de objetos de fibras naturais e sintticas. Inclui os instrumentos utilizados na costura e cestaria. Ver tambm EQUIPAMENTO DE ARTISTAS/ARTESOS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(37,37,'tnc_tax_27','Objetos usados na extrao mineral, seja ela subterrnea ou de superfcie. Inclui, tambm, equipamento de prospeco. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(38,38,'tnc_tax_27','Objetos usados na criao, recriao, engorda e domesticao de animais, bem como os utilizados na transformao e beneficiamento de produtos animais. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(39,39,'tnc_tax_27','Objetos usados em diversas atividades profissionais. Inclui, tambm, os utilizados na construo civil. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(40,40,'tnc_tax_27','Objetos usados no exame, teste, diagnstico e tratamento do ser humano e de animais. Inclui o equipamento de dentistas e farmacuticos, bem como o utilizado pela medicina popular. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',28,0),(41,41,'tnc_tax_27','Objetos criados para servir de brinquedo ou serem usados em jogos, sorteios, atividades esportivas etc. Exclui indumentria e mobilirio. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(42,42,'tnc_tax_27','Objetos usados como sinais distintivos,individuais ou coletivos, de funo, dignidade, posto,comando, poder, nobreza, nao etc. Inclui os respectivos acessrios e exclui mobilirio e indumentria.Ver tambm OBJETOS CERIMONIAIS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(43,43,'tnc_tax_27','Objetos usados em cerimnias e/ou rituais conduzidos de forma sistemtica e geralmente prescrita, sejam eles civis, religiosos ou militares. Exclui instrumentos musicais, mobilirio e indumentria. Ver tambm INSGNIAS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(44,44,'tnc_tax_27','Objetos usados em cerimnias promovidas por instituies, pblicas ou privadas, civis ou militares. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',43,0),(45,45,'tnc_tax_27','Objetos cuja funo principal  homenagear pessoas e lugares, ou comemorar eventos, e que, geralmente, no cumprem funo utilitria. Objetos com funo utilitria definida, mas que contm decorao de carter comemorativo, sero includos nas respectivas classes (ex.: vaso comemorativo pertence  subclasse ACESSRIO DE INTERIORES). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',43,0),(46,46,'tnc_tax_27','Objetos usados em cerimnias de culto e rituais de diversas religies. Ver tambm OBJETO DE DEVOO PESSOAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',43,0),(47,47,'tnc_tax_27','Objetos relativos aos mortos e s cerimnias fnebres. Inclui os respectivos acessrios. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',43,0),(48,48,'tnc_tax_27','Objetos usados para transmitir informaes aos seres humanos. Ver tambm ARTES VISUAIS/CINEMATOGRFICA, MEDIO/REGISTRO/OBSERVAO/PROCESSAMENTO e TRABALHO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(49,49,'tnc_tax_27','Alguns museus no possuem setores de biblioteca e arquivo. Assim, seus livros, peridicos, documentos de arquivo etc. no recebem o tratamento tcnico biblioteconmico ou arquivstico condizentes.  para esses museus, sobretudo, que se abriu esta subclasse, que rene documentos textuais e cartogrficos, bem como os iconogrficos excludos da classe ARTES VISUAIS/CINEMATOGRFICA. Exclui MATERIAL DE PROPAGANDA. Ver tambm EQUIPAMENTO DE COMUNICAO SONORA/VISUAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',48,0),(50,50,'tnc_tax_27','Objetos usados na escrita, autenticao, guarda e transporte de documentos textuais, e respectivos acessrios, inclusive os de leitura. Exclui mobilirio. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',48,0),(51,51,'tnc_tax_27','Objetos usados para ampliar, registrar, reproduzir e armazenar sons significativos para a comunicao humana. Inclui ainda os utilizados como sinal visual ou sinalizadores, projetores e visores de imagens, modelos anatmicos e topogrficos, globos terrestres e material didtico que no se inclua nas demais subclasses do item 10. Ver tambm DOCUMENTO, EQUIPAMENTO DE TELECOMUNICAO e INSTRUMENTO MUSICAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',48,0),(52,52,'tnc_tax_27','Objetos que facilitem a comunicao  distncia, geralmente, por meio de equipamento eletrnico. Ver tambm EQUIPAMENTO DE COMUNICAO SONORA/VISUAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',48,0),(53,53,'tnc_tax_27','Objetos cuja principal funo  a propaganda. Os que cumprem outras funes bem definidas, mas cuja decorao  de carter propagandstico, sero includos nas respectivas classes (ex.: cinzeiro com o nome de um restaurante pertence  subclasse ARTIGO DE TABAGISMO). Ver tambm EQUIPAMENTO DE ATIVIDADES COMERCIAIS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',48,0),(54,54,'tnc_tax_27','Artefatos que servem como veculo para de passageiros ou carga. Inclui seus acessrios.Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(55,55,'tnc_tax_27','Exclui equipamento de comunicao e instrumentos de preciso/pticos. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',54,0),(56,56,'tnc_tax_27','Exclui equipamento de comunicao e instrumentos de preciso/pticos. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',54,0),(57,57,'tnc_tax_27','Exclui equipamento de comunicao e instrumentos de preciso/pticos. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',54,0),(58,58,'tnc_tax_27','Inclui os fluviais. Acrescentar aos descritores abaixo, quando necessrio, os termos vela, motor ou misto (vapor/motor e vela) entre parnteses (ex.: Fragata (Vela), Fragata (Motor), Fragata (Mista). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',54,0),(59,59,'tnc_tax_27','',54,0),(60,60,'tnc_tax_27','',54,0),(61,61,'tnc_tax_27','Objetos criados para servir s necessidades pessoais dos indivduos, tais como proteo e higiene do corpo, adorno, crena etc. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(62,62,'tnc_tax_27','Objetos usados para suster e/ou fixar peas de vesturio ou penteados, mesmo quando fragmentos, adereos de mo e cabeleiras que complementem trajes. Ver tambm OBJETO DE ADORNO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',61,0),(63,63,'tnc_tax_27','Objetos relacionados ao hbito de fumar, aspirar ou mascar tabaco, outras ervas e drogas. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',61,0),(64,64,'tnc_tax_27','Objetos relacionados  higiene e esttica pessoais e aos atos de vestir e calar. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',61,0),(65,65,'tnc_tax_27','Exclui mobilirio. Ver tambm OBJETO DE AUXILIO/CONFORTO PESSOAIS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',61,0),(66,66,'tnc_tax_27','Inclui os respectivos acessrios. Ver tambm ACESSRIO DE INDUMENTRIA. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',61,0),(67,67,'tnc_tax_27','Objetos criados para suprir deficincias fsicas dos seres humanos e/ou para lhes dar maior comodidade, e que no se incluem nas demais subclasses do item 12. Inclui os respectivos acessrios. Ver tambm ARTIGO DE VIAGEM/CAMPANHA. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',61,0),(68,68,'tnc_tax_27','Objetos usados como smbolos de uma crena, para atrair a sorte ou afastar malefcios, que as pessoas, geralmente, trazem consigo. Ver tambm OBJETO DE CULTO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',61,0),(69,69,'tnc_tax_27','Objetos usados como vestimentas ou calados por seres humanos. Inclui, tambm, as coberturas de cabea e mscaras que complementem trajes. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',61,0),(70,70,'tnc_tax_27','Objetos usados para infligir penas corporais aos seres humanos ou para a autopenitncia. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(71,71,'tnc_tax_27','',70,0),(72,72,'tnc_tax_27','',70,0),(73,73,'tnc_tax_27','Objetos usados na medio, registro e observao de fenmenos, substncias, propriedades, volume e massa, ou ainda para processar dados e ampliar a capacidade visual dos seres humanos. Exclui os de correo de defeitos visuais, como os culos, e os que registram sons. Inclui os respectivos acessrios. Ver tambm COMUNICAAO e TRABALHO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(74,74,'tnc_tax_27','',73,0),(75,75,'tnc_tax_27','Objetos usados para processar dados por manuais, mecnicos ou eletrnicos. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',73,0),(76,76,'tnc_tax_27','Objetos usados para embalar produtos e mercadorias, e recipientes com funo no determinada. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0),(77,77,'tnc_tax_27','Amostras de natureza animal, vegetal ou mineral, em estado bruto ou processadas, desde que no constituam um objeto propriamente dito. Inclui, tambm, amostras ou fragmentos de rendas, tecidos, couros, cabelos etc., quando no tiverem constitudo parte de um objeto ou quando este no pde ser identificado, e acessrios de artefatos que no puderam ser determinados. Os mostrurios para fins comerciais pertencem  subclasse EQUIPAMENTO DE ATIVIDADES COMERCIAIS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museolgicos. Ministrio da Cultura, Secretaria do Patrimnio Histrico e Artstico Nacional, Fundao Nacional Pr-Memria, Coordenadoria Geral de Acervos Museolgicos, 1987.',0,0);
